import React, { Component } from 'react';

class Crimes extends Component {
    render() { 
        const { crimes:rows, onEdit, onSort } = this.props;
        console.log(onEdit);
        return ( 
            <React.Fragment>
                <p>Showing {rows.length} movies in the database.</p>
                    <table className="table">
                        <thead>
                            <tr>
                                <th scope="col" onClick={() => onSort('id')}>#</th>
                                <th scope="col" onClick={() => onSort('category_id')}>Category</th>
                                <th scope="col" onClick={() => onSort('latitude')}>Latitud</th>
                                <th scope="col" onClick={() => onSort('longitude')}>Longitude</th>
                                <th scope="col" onClick={() => onSort('street_name')}>Street Name</th>
                                <th scope="col">Outcome</th>
                                <th scope="col" onClick={() => onSort('month')}>Month</th>
                                <th scope="col">Delete</th>
                            </tr>
                        </thead>
                        <tbody>
                            {rows.map(out => (
                                <tr key={out.id}>
                                    <td>{out.id}</td>
                                    <td>{out.category_id}</td>
                                    <td>{out.latitude}</td>
                                    <td>{out.longitude}</td>
                                    <td>{out.street_name}</td>
                                    <td>{out.outcome_status}</td>
                                    <td>{out.month}</td>
                                    {/* <td><Like onLike={onLike} liked={movie.movie.liked} movieId={movie.movie.id} /></td> */}
                                    <td>
                                        <button
                                            // onClick= {() => onEdit(out.id)}
                                            className="btn btn-primary btn-sm"
                                        >
                                            Details
                                        </button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
            </React.Fragment>
         );
    }
}
 
export default Crimes;
